import {
    fetchCompForm,
    clearCompForm,
    makeOrderRequestAC,
} from './actions'

const makeOrderRequest = (form) => (dispatch, getState) => {
    const data = {
        alias: getState().compOrderForm.alias,
        ...form
    }

    const res = dispatch(makeOrderRequestAC(data))
    console.log(res)
}

export {
    fetchCompForm,
    clearCompForm,
    makeOrderRequest
}
